DROP TABLE IF EXISTS `bot_setting`;
CREATE TABLE `bot_setting`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `tgtoken` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `belongs` tinyint(1) NULL DEFAULT 1 COMMENT '1--系统所属 2-商户所属',
  `cname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机器人name',
  `cusername` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机器人名字',
  `mech_id` int(11) NULL DEFAULT 0 COMMENT '默认为0-系统所属\r\n不然就是商户ID\r\n\r\n唯一-不重复',
  `sta` tinyint(1) NULL DEFAULT 1 COMMENT '1-在用 2-不再用',
  `ctype` tinyint(1) NULL DEFAULT 0 COMMENT '1--siglebot\r\n2-群bot',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

