-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trade_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'epusdt订单号',
  `order_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '客户交易id',
  `block_transaction_id` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '区块唯一编号',
  `actual_amount` decimal(19, 4) NOT NULL COMMENT '订单实际需要支付的金额，保留4位小数',
  `amount` decimal(19, 4) NOT NULL COMMENT '订单金额，保留4位小数',
  `token` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '所属钱包地址',
  `status` int(11) NOT NULL DEFAULT 1 COMMENT '1：等待支付，2：支付成功，3：已过期',
  `notify_url` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '异步回调地址',
  `redirect_url` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '同步回调地址',
  `callback_num` int(11) NULL DEFAULT 0 COMMENT '回调次数',
  `callback_confirm` int(11) NULL DEFAULT 2 COMMENT '回调是否已确认？ 1是 2否',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `mech_id` int(8) NULL DEFAULT NULL COMMENT '商户ID',
  `item_id` int(11) NULL DEFAULT NULL COMMENT '绑定的游戏itemID',
  `cuid` int(11) NULL DEFAULT NULL COMMENT '用户ID',
  `payed_number` int(11) NULL DEFAULT NULL COMMENT '付款号',
  `is_reword` tinyint(1) NULL DEFAULT 0 COMMENT '是否中奖 0 -否 1-是',
  `is_extra` tinyint(1) NULL DEFAULT 0 COMMENT '是否是订单满了之后额外的订单',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `orders_order_id_uindex`(`order_id`) USING BTREE,
  UNIQUE INDEX `orders_trade_id_uindex`(`trade_id`) USING BTREE,
  INDEX `p_orders_block_transaction_id_index`(`block_transaction_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1294 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

